import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
function ReturnList() {
  const [rtrns, setRtrns] = useState([]);
  useEffect(() => {
    fetchData();
  }, []);
  const fetchData = async () => {
    try {
      const data = [
      ];
      setRtrns(data);
    } catch (error) {
      console.error('Error fetching data: ', error);
    }
  };
