  };
  return (
    <div>
        <div className="bg-secondary border-top p-5 text-white mb-3">
              <Link to="/">
                <img alt="logo" src="../../images/(0).png" style={{ marginLeft : "150px", height: "44px", width: "159px" }} />
              </Link>
          <h1 className="display-6 text-center" style={{marginTop: "-45px"}}>Return Orders</h1>
          <button className="btn btn-dark btn-block float-end">
                <Link to="/account/signinadmin" className="text-white" style={{color : "white", textDecoration : "none", fontSize : "18px"}}>
                  Logout
                </Link>
              </button>
        </div>
    <div style={{padding:"40px"}}>
      <div className="table-responsive">
        <table className="table table-striped table-bordered table-hover table-condensed" width="80%" align="center">
          <thead>
            <tr>
              <th style={{backgroundColor:"black",color:"white"}}><center>Order ID</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Order Date</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Return Date</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Product Name</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Product Price</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Shipping Address</center></th>
              <th style={{backgroundColor:"black",color:"white"}}><center>Return Status</center></th>
            </tr>
          </thead>
          {rtrns && rtrns.length > 0 ? (
            <tbody>
              {rtrns.map(rtrn => (
                <tr key={rtrn.orderId}>
                  <td><center>{rtrn.orderId}</center></td>
                  <td><center>{rtrn.orderDate}</center></td>
                  <td><center>{rtrn.returnDate}</center></td>
                  <td><center>{rtrn.productName}</center></td>
                  <td><center>{rtrn.productPrice}</center></td>
                  <td><center>{rtrn.shippingAddress}</center></td>
                  <td>
                    <center>
                      {rtrn.returnStatus}
                        <button onClick={() => handleButtonClick(rtrn.orderId, 'Return Confirmed')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', margin: '10px', borderColor:'black' }}>Return Confirmed</button>
                        <button onClick={() => handleButtonClick(rtrn.orderId, 'Pickup')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', marginRight: '10px', borderColor:'black' }}>Pickup</button>
                        <button onClick={() => handleButtonClick(rtrn.orderId, 'Refund Completed')} className="btn btn-primary btn-md text-white" style={{ backgroundColor: 'black', marginRight: '10px', borderColor:'black' }}>Refund Completed</button>
                    </center>
                  </td>
                </tr>
              ))}
            </tbody>
          ) : null}
        </table>
      </div>
    </div>
    </div>
  );
}
export default ReturnList;
